define("Core/helpers/Hcontrol/screen",function(){return{fromScreen:function(e){var t=document.body,o=document.documentElement,n=window.pageYOffset||o.scrollTop||t.scrollTop,l=window.pageXOffset||o.scrollLeft||t.scrollLeft,c=o.clientTop||t.clientTop||0,r=o.clientLeft||t.clientLeft||0,f=e.top+n-c,d=e.left+l-r;return{top:Math.round(f),left:Math.round(d)}},toScreen:function(e){var t=document.body,o=document.documentElement,n=window.pageYOffset||o.scrollTop||t.scrollTop,l=window.pageXOffset||o.scrollLeft||t.scrollLeft,c=o.clientTop||t.clientTop||0,r=o.clientLeft||t.clientLeft||0,f=e.top-n+c,d=e.left-l+r;return{top:Math.round(f),left:Math.round(d)}}}});